/* ==UserStyle==
@name           Userstyles - Dark 2018
@namespace      USO Archive
@author         Gibbu
@description    `Makes Userstyles.org into a dark theme, so it doesn't murder your eyes.`
@version        20181101.3.5
@license        CC-BY-4.0
@preprocessor   uso
@advanced dropdown theme-d-l "Theme" {
	d "Dark*" <<<EOT   :root {

    --bg1: #111;
    --bg2: #171717;
    --bg3: #1a1a1a;
    --bg4: #222;
    --bg5: #272727;
    --bg6: #2a2a2a;
    --bg7: #333;

    --color1: #eee;
    --color2: #ccc;
    --color3: #aaa;

    --blue: #3498db;

  } EOT;
l "Grey" <<<EOT   :root {

    --bg1: #2c2c2c;
    --bg2: #353535;
    --bg3: #3a3a3a;
    --bg4: #444;
    --bg5: #474747;
    --bg6: #4a4a4a;
    --bg7: #555;

    --color1: #eee;
    --color2: #ccc;
    --color3: #aaa;

    --blue: #3498db;

  } EOT;

}
@advanced text notes "Notes Height" "400"
@advanced dropdown hide-footer-y-n "Remove Footer" {
	n "No*" <<<EOT  EOT;
y "Yes" <<<EOT #footer {
    display: none;
} EOT;

}

==/UserStyle== */
@-moz-document domain("userstyles.org") {
/*[[theme-d-l]]*/


.style_card  {
	box-shadow: none !important;
}


/*  BG1  */
body, #nav-view, #navigation, #landing_page_div .top_landing_page_div, #nav-view-responsive {
	background: var(--bg1) !important;
}

/*  BG2  */
.style_card, #footer, #style_installed_button, .edit-setting, .advancedsettings_shown, .us-stylecard--short, .us-stylecard--long {
	background: var(--bg2) !important;
}

/*  BG3  */
.navigation_link:hover, #header, #Head, #landing_page_div .bottom_landing_page_div, .navigation {
	background: var(--bg3) !important;
}

/*  BG4  */
.navigation .links-box .navigation-link:hover, .contact-input, .contact-input-large, #login-existing, #password-existing, #password, #password_confirmation, .Info, ul.token-input-list, .TextBoxWrapper textarea, .TextBoxWrapper input:not([type="radio"]):not([type="checkbox"]), .header-search .search_input {
    background: var(--bg4);
}
/* BG5 */
.header-search .search_input.focused {
    background: var(--bg5);
}
/* BG7 */
li.token-input-token, div.token-input-dropdown, div.token-input-dropdown *, .header-search .type_search {
    background: var(--bg7) !important;
}


/*  COLOR1 (#eee)  */
h4 a, h4, .navigation_title, #copyrights, h1, h4 a:visited, #information_value, #share_div, .title_setting, .upload_image_label, #landing_page_div .top_landing_page_div .coming_soon_div .coming_soon_subtitle, #title_long, #title_long a, .style_author_long,  .SiteTitle a, #Head a, #title_long a:visited, .navigation .links-box .navigation-link .navigation-title, .navigation .navigation-category, .contact-bold-font, #styles-writing, #styles-coding, #styles-installing, .styles-help, #input-fields label, .contact-input, .contact-input-large, #site-uploading, #site-search, .PageContent b, .PageContent h1, .PageContent i, .PageContent p, .PageContent h2, .PageContent strong, .PageContent font, #login-existing, #password-existing, #password, #password_confirmation, .TextBoxWrapper textarea, .TextBoxWrapper input:not([type="radio"]):not([type="checkbox"]), li.token-input-token, .header-search .search_input .input_text_search {
	color: var(--color1) !important;
}

/*  COLOR2 (#ccc)  */
#headline, #information_key, .text_style_page, #applies_link, #landing_page_div .bottom_landing_page_div .android_feature_div .android_feature_text div, h4#title_long a {
	color: var(--color2) !important;
}

/*  COLOR3 (#aaa)  */
#information_key_left, #infomation_value_left, #landing_page_div .top_landing_page_div .coming_soon_div .coming_soon_text, #landing_page_div .top_landing_page_div .coming_soon_div .coming_soon_helpus {
	color: var(--color3) !important;
}

/*  BLUE  */
h4 a:hover, a {
	color: var(--blue) !important;
}





/*  BUTTONS  */
.see_more, .div-arrow, #css_button, #send_feedback_button, .white_button, .css_button, .advanced_button, .customize_button {
	background: var(--bg3) !important; color: var(--color1) !important; border: transparent !important; transition: 0.2s ease !important;
}
.see_more:hover, .div-arrow:hover, #css_button:hover, #send_feedback_button:hover, .white_button:hover, .css_button:hover, .advanced_button:hover, .customize_button:hover {
	background: var(--bg4) !important; color: var(--color1) !important; border: transparent !important;
}




/*  BORDER TRANSPARENT  */
.screenshot_wrapper, .contact-input, .contact-input-large, #login-existing, #password-existing, #password, #password_confirmation, ul.token-input-list, li.token-input-token, div.token-input-dropdown, .TextBoxWrapper {
	border-color: transparent !important;
}




/*  SEPERATE RULES  */
body {
	color: var(--color2) !important;
}
.linksBox .navigation_link:last-child, #single_discussion {
	box-shadow: none;
    border-bottom: 1px solid var(--bg5);
}
#archive_style_button {
	box-shadow: none !important;
}
#archive_style_button:hover {
	background: #c14430; color: #fff;
}
#install_style_button {
	box-shadow: none;
}
#install_style_icon {
	margin-top: 5px;
}
#create_new_style:hover {
	background: var(--blue) !important; 
	border-color: var(--blue) !important;
}
#create_new_style a, h4 a {
	transition: 0.2s ease; 
	-webkit-transition: 0.2s ease;
}
#create_new_style:hover span {
	color: var(--color1) !important;
}
.form-controls input[type=text], .form-controls textarea, .form-controls input[type=url], #edit-style-settings input:not([type]), #edit-style-settings input[type="text"], .form-controls input[type=button] {
	background: var(--bg4) !important; 
	border: 1px solid #444 !important; 
	color: var(--color1) !important; 
	box-sizing: border-box;
}
#style-settings select {
	background: var(--bg4);
	border: none;
	color: #fff;
	padding: 5px
}
#style-settings select option {
	padding: 2px 0;
}
.option-user-url {
	background: var(--bg4);
	border: none;
	color: #fff;
}
#navigation .linksBox:first-child .logo_navigation_link, #navigation .linksBox:last-child .logo_navigation_link, .MeButton span, .label_image > img:first-child, #navigation .linksBox:nth-child(5) .navigation_link img, .navigation .links-box .navigation-link .logo-navigation-link {
	filter: invert(1);
	-webkit-filter: invert(1);
}
#overlay-info {
	background: var(--bg1);
	border-radius: 0 !important;
}
.style_card_long, .line_seperator {
	box-shadow: inset 0 -1px 0 0 var(--bg4)
}
.view_details {
	background: var(--bg3) !important; 
	color: var(--color1) !important; 
	border: transparent !important;
}
#title_long:hover, #title_long:hover a {
	color: var(--blue) !important;
}
.Item.Read {
	background: var(--bg2);
}
#style_installed_button {
	border: none;
	padding: 0 5px;
	box-shadow: inset 0 0 0 2px #2ecc71;
}
pre {
	background: var(--bg3);
	border-color: var(--bg4) !important;
}
code {
	color: var(--color1);
	background: var(--bg3);
    border-color: var(--bg4) !important;
}
.Button {
	background: var(--bg4);
	text-shadow: none;
	box-shadow: none;
	border: 2px solid var(--bg4);
}
.Button:hover {
	background: var(--bg7);
	border-color: var(--bg7);
}
#Head .SiteSearch .InputBox, .EditCommentForm textarea.TextBox, .CommentForm textarea.TextBox {
	background: var(--bg2);
	color: var(--color1);
}
.SiteSearch .Button, .OptionsTitle {
	filter: invert(1);
	-webkit-filter: invert(1);
}
#Body {
	padding-top: 25px;
}
	.style_category_card_wrapper {
	background: var(--bg3);
	box-shadow: none;
}
.style_category_card_wrapper:hover {
	box-shadow: none;
}
.style_category_card_wrapper #category_style_card_title {
	color: var(--blue);
}
.setting_div {
	width: 50%;
	margin-right: 0;
	margin-bottom: 10px;
}
.errorExplanation {
	background: transparent;
	border: 3px solid red;
	border-radius: 5px;
}
#stylish-code {
	font-family: 'Courier', 'Courier New', monospace;
	height: 500px;
	background: var(--bg2);
	border: none;
	padding: 10px;
	box-sizing: border-box;
	font-weight: bold;
}
.Button, .DiscussionForm .PostOptions label {
	color: #ddd;
}
.Button:hover {
    color: #fff;
}
.DiscussionForm .Category, .DiscussionForm input.InputBox, .DiscussionForm textarea {
    background: var(--bg2);
    color: #eee;
}
.text_setting_input {
    background: var(--bg4) !important;
    border-color: var(--bg4) !important;
    color: var(--color1) !important;
}
#landing_page_div .top_landing_page_div .coming_soon_div .coming_soon_helpus {
    width: 100%;
}
#top_android_button {
    background: var(--bg5);
    box-shadow: none !important;
    width: 46px !important;
}
#top_android_button:hover {
    background: var(--bg6);
}
#top_android_button .android_button_text {
    display: none;
}
#search_input {
    background: var(--bg5) !important;
}
#search_input:hover {
    background: var(--bg7) !important;
}
#search_input input {
    color: #fff !important;
}
#landing_page_div .top_landing_page_div .coming_soon_div .coming_soon_seperator {
    border-bottom-color: var(--bg7);
}
.adLong, .style_card_long:empty, .catalogBanner.box, .navigation_ad, .adContainer {
    display: none;
}
#title_div {
    box-shadow: inset 0 -1px 0 0 var(--bg7);
}
.advancedsettings_shown {
    max-width: 668px;
}
.style_card_long:nth-child(3), .style_card_long:nth-child(13) {
	display: none;
}
.statistic table, th, td {
	border-color: var(--bg6);
	padding: 5px;
}
.statistic table a, th a, td a {
	text-decoration: none;
}
td.obsolete, td.obsolete ~ td, .navigation-ad {
	display: none;
}
.author-styles tbody tr:nth-child(even) {
	background: var(--bg2);
}
.us-stylecard--short, .us-stylecard--short .us-stencil {
    box-shadow: none;
    border: none;
}
.navigation {
    padding: 68px 0 0 0;
    z-index: 10;
    margin: 0;
}
#header {
    z-index: 12;
}
.navigation .navigation-category {
    padding-left: 10px;
}
.us-category--stylecard-short {
    transition: 0.2s ease;
}
#footer {
    padding-left: 200px;
    box-sizing: border-box;
}
.navigation .links-box {
    box-shadow: 0 -1px 0 0 var(--bg5), 0 1px 0 0 var(--bg5);
}
.navigation .links-box .navigation-link {
    box-shadow: 0 -1px 0 0 var(--bg5);
}
.navigation .links-box:nth-child(3) .logo-navigation-link {
    filter: invert(0);
}







/***** SETTINGS *****/
/*[[hide-footer-y-n]]*/
#notes_textarea {
	background: var(--bg1) !important; 
	color: var(--color2) !important;
	height: /*[[notes]]*/px;
	max-height: /*[[notes]]*/px;
}
}

/* ==UserStyle==
@name           DarkSearch for Google
@namespace      USO Archive
@author         Nass O
@description    `The best Dark theme for Google.Contribute to the style : https://github.com/Nass-O/DarkSearchFirefox users : Install the Dark Scrollbar (DarkBar) https://userstyles.org/styles/122382/darkbar-firefox► Check out my YouTube style : https://userstyles.org/styles/117673/darktube`
@version        20170220.19.54
@license        NO-REDISTRIBUTION
@preprocessor   uso
==/UserStyle== */
@-moz-document regexp("https?://www.google.(com|([a-z]{2}))(.[a-z]{2})?."), regexp("https?://www.google.(com|([a-z]{2}))(.[a-z]{2})?/((\\?|webhp|search|gfe_rd|auth|gws_rd|#q|imghp|#gfe_rd|#safe|#pws|#tbs|#gws|#tbm).*)"), regexp("https?://encrypted.google.(com|([a-z]{2}))(.[a-z]{2})?/((\\?|webhp|search|gfe_rd|auth|gws_rd|#q|imghp|#gfe_rd|#safe|#pws|#tbs|#gws|#tbm).*)"), regexp("https?://encrypted.google.(com|([a-z]{2}))(.[a-z]{2})?."), regexp("https?://www.google.(com|([a-z]{2}))(.[a-z]{2})?/_/chrome/newtab\\?.*") {
    /*
     * Name:    DarkSearch for Google
     * Author:  Nass O
     * Version: v2.1.8
     */

    /* Background */
    html, body, #cnt, .rg_l, #botabar {
        background: #101010 !important;
        color: #c5c5c5;
    }
    /* Inverting colors */
    .qbh, .s2tb .google-logo, .gb_Vb, #wob_gsp, ._kac, #qbi, .ab_icon, .gsok_a, ._Fnc, ._Jxg, .stt-uf, ._dVi, .kcb.checked::after, ._gW {
        -webkit-filter: invert(1) grayscale(1) !important;
        -moz-filter: invert(1) grayscale(1) !important;
        filter: invert(1) grayscale(1) !important;
    }
    ._Zgf {
        -webkit-filter: invert(.6) grayscale(1) !important;
        -moz-filter: invert(.6) grayscale(1) !important;
        filter: invert(.6) grayscale(1) !important;
    }
    .gsri_a, .sbico {
        -webkit-filter: grayscale(.6) !important;
        -moz-filter: grayscale(.6) !important;
        filter: grayscale(.6) !important;
    }
    ._n0b, ._MNk._wtf svg {
        -webkit-filter: invert(.9) !important;
        -moz-filter: invert(.9) !important;
        filter: invert(.9) !important;
    }
    #qbx {
        -webkit-filter: invert(.3) !important;
        -moz-filter: invert(.3) !important;
        filter: invert(.3) !important;
    }
    /* Images opacity */
    #hplogo, #logo img, .gbii {
        opacity: .7;
        transition: opacity .2s;
    }
    #hplogo:hover, #logo img:hover, .gbii:hover {
        opacity: 1;
        transition: opacity .5s;
    }

    /* Scrollbar Chrome*/
    *::-webkit-scrollbar {
        width: 10px !important;
        height: 10px !important;
        background: #1e1e1e !important;
        border: 1px solid #252525 !important;
    }
    *::-webkit-scrollbar-button {
        display: none !important;
    }
    *::-webkit-scrollbar-thumb,
    *::-webkit-scrollbar-track {
        border: 0 !important;
        box-shadow: none !important;
    }
    *::-webkit-scrollbar-thumb {
        min-height: 28px !important;
        background: #333 !important;
    }
    *::-webkit-scrollbar-corner,
    *::-webkit-scrollbar-track {
        background: #1e1e1e !important;
    }

    /* Text Input #C5C5C5 */
    input, #lst-ib, select {
        color: #C5C5C5 !important;
    }
    input {
        background-color: #222;
    }

    /* Auto completion
    input#lst-ib.gsfi {
        background: url(data:image/gif;base64,R0lGODlhAQABAID/AMDAwAAAACH5BAEAAAAALAAAAAABAAEAAAICRAEAOw%3D%3D) rgba(34, 34, 34, 0.74)!important;

    }
    */

    /* Header */
    .sfbgg {
        background-color: #151515 !important;
        border-bottom: none !important;
        background-image: none;
    }
    .sfbgx {
        background-color: #151515 !important;
        border-bottom-color: #222 !important;
    }
    .mw, ._PJ {
        background: #101010 !important;
    }

    /* Footer */
    #fbar {
        background: #1d1d1d !important;
        border-top: 1px solid #252525 !important;
    }

    /* Search options bar */
    #hdtbSum {
        background: #151515 !important;
        border-bottom: 1px solid #1d1d1d !important;
    }
    #appbar, #hdtbMenus, #hdtb {
        background: #101010 !important;
    }
    #hdtb, #hdtb.hdtba #hdtbMenus {
        border-bottom-color: #101010 !important;
    }

    /* Visited links */

    /* Titles (blue) #7EB3F3 */
    .rllt__action-button:visited, #gsr .rllt__action-button:active, ._eMi, #sbsb_f, #sbsb_f:hover, a:link, .w, #prs a:visited, #prs a:active, .q:active, .q:visited, .kl:active, .tbotu, a.iu-card-header, a.iu-card-header:hover, a.iu-card-header:visited {
        color: #9BAED2;
    }
    ._tX, ._Qqb._tX.ellip, ._Icb > a, .ab_dropdownlnkinfo:hover {
        color: #7EB3F3 !important;
    }

    /* Links (blue) #89A2CF*/
    a.iu-card-header, a.iu-card-header:hover, a.iu-card-header:visited, a.fl:link, .fl a, .flt, a.flt, .gl a:link, a.mblink, .mblink b, #foot #navcnt a, a.fl.q._KCd._tWc, .st .f .fl, div.duf3d a, ._YAp, .lr_dct_more_btn, a ._l6b {
        color: #9BAED2 !important;
    }

    /* Text #BDBDBD */
    .rreh ._fk, span[style="color:#222"], #center_col ._Ak, #rhs ._Ak, ._i2g, ._g2g, .s, ._cnc, #brs .med, ._Adb, ._tyb, .shop__secondary, .shop__secondary:link, .shop__secondary:visited, ._Lqc, .lc-loc-text, .gko-ctrl, .gko-ctrl:link, .gko-ctrl:visited, ._uxi, ._Hxi, ._gah {
        color: #BDBDBD !important;
    }

    /* Subtext #9f9f9f */
    .sben_a, ._Lgc .gl, ._Wmc, ._zX, ._gdf, ._RWc, span.f.nsa._uQb, .f a:link, ._uQb, ._bnc, ._Tib, ._Tib a.fl, .f, .f a:link {
        color: #aaa !important;
        font-style: italic !important;
    }

    /* Matching words in search results #D3D3D3*/
    .ads-creative b, .s .st em, .st.s.std em {
        color: #D3D3D3;
    }

    /* visited links #BD90D7 */
    .mblink:visited, a:visited, .sbpqs_a, a.fl:visited, .st .f .fl:visited {
        color: #B8A7C3 !important;
    }
    /* URL color #69AC82 */
    .a, cite, cite a:link, cite a:visited, .cite, .cite:link, #_bGc > i, .bc a:link, ._IId {
        color: #85A691 !important;
    }
    /* Strong Blue links #54A6F8 */
    #hdtb-msb .hdtb-mitem.hdtb-msel, #hdtb-msb .hdtb-mitem.hdtb-msel-pre {
        border-bottom: 3px solid #84a6e0 !important;
        color: #84a6e0 !important;
    }
    #foot #navcnt .cur {
        color: #fff !important;
    }
    /* Strong White links */
    .kno-ecr-pt {
        color: #eee!important;
    }

    /* Links (white) #c5c5c5 */
    .flt-date, .price, ._rl, td._xh.vk_gy._Vi, div._b5e .vk_bk, ._dDh._XDh, ._xZc, ._wD ._Xbe, ._Tsf, .hdtb-mn-hd, ._tvg, ._LJ .exp-txt-c, .mod, ._eF, .rg_bb_label, #hdtb-msb #hdtb-more, #hdtb-msb #hdtb-tls, ._pk, a.fl, a._Gs, #hdtb .hdtb-mitem a, .ftl, #footer a, #gb#gb a.gb_P, #gb#gb span.gb_P, ._HR a, #swml a {
        color: #a3a3a3 !important;
    }
    .gb_Q span {
        opacity: 1;
    }
    /* Hover links (white) #E1E1E1 */
    a._Gs:hover, ._HR a, #swml a:hover, .hdtbItm label:hover, .hdtbItm a:hover, #hdtb-more-mn a:hover, #hdtb .hdtb-mitem a:hover, .hdtb-mn-hd:hover, #hdtb-more:hover, #hdtb-tls:hover {
        color: #E1E1E1 !important;
    }

    /* Mini search button */
    #sblsbb, #sblsbb:hover {
        background-color: #2E2E2E;
    }

    /* Button Shadow */
    .jhp input[type="submit"], .sbdd_a input, .gbqfba {
        background-image: -webkit-gradient(linear, left top, left bottom, from(#222), to(#222));
        background-image: -webkit-linear-gradient(top, #222, #222);
        background-image: -moz-linear-gradient(center top, #222, #222);
        background-image: -o-linear-gradient(top, #222, #222);
        background-color: #222;
        border-color: #242424;
        color: #acacac;
        box-shadow: 0 0 5px #0F0F0F;
    }

    /* Button Shadow Hover */
    .jhp input[type="submit"]:hover, .sbdd_a input:hover, .gbqfba:hover {
        background-image: -webkit-gradient(linear, left top, left bottom, from(#2E2E2E), to(#2E2E2E));
        background-image: -webkit-linear-gradient(top, #2E2E2E, #2E2E2E);
        background-image: -moz-linear-gradient(center top, #2E2E2E, #2E2E2E);
        background-color: #2E2E2E;
        border-color: #2d2d2d;
        color: #ccc;
        box-shadow: 0 0 5px #0F0F0F;
    }

    /* Button */
    .ab_button, #hdtb-tls:hover, .ksb {
        background-image: -webkit-gradient(linear, left top, left bottom, from(#222), to(#222));
        background-image: -webkit-linear-gradient(top, #222, #222);
        background-image: -moz-linear-gradient(center top, #222, #222);
        background-image: -o-linear-gradient(top, #222, #222);
        background-color: #222;
        border-color: #262626;
        color: #acacac !important;
    }
    #hdtb-msb .hdtb-tl-sel, #hdtb-msb .hdtb-tl-sel:hover {
        background: -webkit-linear-gradient(top, #232323, #272727) !important;
        -webkit-box-shadow: inset 0 1px 2px 0 rgba(0,0,0,.1) !important;
        border: 1px solid #1e1e1e !important;
        box-shadow: inset 0 1px 2px 0 rgba(0,0,0,.2) !important;
    }
    #gb .gb_qb a.gb_wb.gb_wb {
        color: #fff !important;
    }

    /* Button Hover */
    .ab_button:hover, .ksb:hover {
        background-image: -webkit-gradient(linear, left top, left bottom, from(#282828), to(#282828));
